import React from "react";
import "./App.css";

import { Routes, Route } from "react-router-dom";
import Nav from "./components/Nav";
import BlogPage from "./components/BlogPage";
import ProfilePage from "./components/ProfilePage";
function App() {
  return (
    <div>
      <Routes>
        {/* <Route
          path="/"
          element={
            <div>
              Lorem ipsum dolor sit amet consectetur adipisicing elit.
              Voluptate, inventore nesciunt cumque fugiat dignissimos excepturi
              eius eos saepe ad eum quisquam ducimus sint magnam obcaecati
              voluptates deserunt. Impedit, minus hic.
            </div>
          }
        ></Route>
        <Route path="/about" element={<div>This is about page</div>}></Route>
        <Route
          path="/movie/:movieId"
          element={<div>This is movie details of movieid</div>}
        ></Route>
